import SchoolIcon from '@mui/icons-material/School';
import GroupIcon from '@mui/icons-material/Group';


const courseMenu={
            url:'/course',
            title:"Course",
            icon:"",
            children:[
                {
                    url:"/createcourse",
                    title:"Create Course",
                    icon:""
                },
                {
                    url:"/viewcourse",
                    title:"View Course",
                    icon:""
                },
                {
                    url:"/managecourse",
                    title:"Manage Course",
                    icon:""
                }
            ]
    }

const schoolMenu={
        url:"/school",
        title:'School',
        icon:<SchoolIcon sx={{color:"cadetblue",fontSize:"60px"}} />,
        children:[
            {
                url:"/createschool",
                title:"Create School",
                icon:<SchoolIcon fontSize="45" color="cadetblue"/>
            },
            {
                url:"/manageschool",
                title:"Manage School",
                icon:<SchoolIcon fontSize="45" color="cadetblue"/>
            }
        ]

}

const groupMenu={
        url:"/group",
        title:"Group",
        icon:<GroupIcon/>,
        children:[
            {
                url:"/creategroup",
                title:"Create Group",
                icon:<GroupIcon/>
            },
            {
                url:"/viewgroup",
                title:"View Group",
                icon:<GroupIcon/>
            },
            {
                url:"/managegroup",
                title:"Manage Group",
                icon:<GroupIcon/>
            },
        ]
}


const superAdminMenuList=[
        schoolMenu,
        groupMenu,
        courseMenu,
]

export {
    superAdminMenuList
}
